import axios from "axios";
const baseUrl = "http://localhost:3001/notes";

const initialGet = () => axios.get(baseUrl);

const postNew = obj => axios.post(baseUrl, obj);

const toggle = (id, obj) => {
  return axios.put(`baseUrl/${id}`, obj);
};

export { initialGet, postNew, toggle };
